import SearchBar from "../SearchBar";
import { Link } from "react-router-dom";
import Logo from "../../assets/logo.png";

export default function Nav(props) {

    return (
        <div style={{
            width: '100%',
            backgroundColor: '#B9E5D3',
            display: 'flex',
            position: 'relative',
            alignItems: 'center',
            boxShadow: '0px 4px 8px',

        }}>
            <img src={Logo} alt='Rick_And_Morty' style={{ width: 250, marginLeft: 15, marginRight: '10%' }} />
            <div ><SearchBar onSearch={props.onSearch} /></div>
            <div style={{
                display: 'flex',
                position: 'absolute',
                right: '30%',

            }}>
                <div
                    style={{
                        margin: 10,
                    }}><Link to={"/home"} style={{
                        textDecoration: 'none',
                        fontWeight: 'bold',
                        color: 'black',
                    }}><div >Home</div></Link></div>
                <div style={{
                    margin: 10,
                    borderTopLeftRadius: '0.3em 1em',
                    borderTopRightRadius: '0.5em 1em',
                    backgroundColor:'red',
                }}><Link to={"/about"} style={{
                    fontWeight: 'bold',
                    textDecoration: 'none',
                    color: 'black',
                }}><div>About</div></Link></div>
            </div>
        </div>
    );

}
